function carregarInfos(){$.ajax({url:`${API_URL}/mobile/agendamentos`,method:"GET",success:function(a){if(0==a.data.length)return Toast.fire({text:"Nenhum outro atendimento encontrado",icon:"warning"}),!1;1==page&&$(".agendamento-lista").html(""),++page,a.data.forEach((a=>{$(".agendamento-lista").append(`<div class="col-12">\n                        <div class="card job-post placeholder-wave">\n                            <div class="card-body p-0">\n                                <div class="d-flex align-items-center media-80 text-center bg-warning me-3 rounded">\n                                    <div class="col-12">\n                                        <h3 class="text-white placeholder">${moment(a.age_datahora).format("DD")}</h3>\n                                        <span class="text-white placeholder">${moment(a.age_datahora).format("MMMM")}</span>\n                                    </div>\n                                </div>\n\n                                <div class="card-info">\n                                    <h6 class="title placeholder">${a.pro_nome}</h6>\n                                    <span class="location placeholder">${a.esp_nome}</span>\n                                    <span class="text-primary placeholder">\n                                        <i class="fa-solid fa-clock"></i>\n                                        ${moment(a.age_datahora).format("HH:MM:SS")}\n                                    </span>\n                                </div>\n                            </div>\n                        </div>\n                    </div>`)}))},error:function(a){$(".agendamento-lista").html(""),Toast.fire({text:a.responseJSON.message,icon:"error"})}})}$((()=>{carregarInfos()}));
